"use strict";

function findNthDigit(n) {
    let bits = 1, t = 9;
    while (n > bits * t) {
        n -= bits * t;
        bits += 1;
        t *= 10;
    }
    let start = Math.pow(10, bits - 1) + Math.floor(n / bits) - 1;
    if (n % bits === 0) {
        return start % 10;
    }
    return parseInt((start + 1).toString()[(n % bits) - 1]);
}

function f_gold(n) {
    return findNthDigit(n);
}
